import React from 'react'

import logo from '../images/logo.pnf'

const Logo = () => {
  return (
    <div className='logo_container'>
<img src="{logo}" alt="logo Image" />
<img src="../images/logo_img.png" alt="logo Image" />


    </div>
  )
}

export default Logo
